package com.demo4.CIWNonStringColectionDo;

public class Movies {

	     private int id;
	     private String name;
		public Movies() {
			super();
			// TODO Auto-generated constructor stub
		}
		public Movies(int id, String name) {
			super();
			this.id = id;
			this.name = name;
		}
		@Override
		public String toString() {
			return "Movies [id=" + id + ", name=" + name + "]";
		}
	   
	     
	     
	     
	
}
